Example: type SimpleEnum struct { VariantIndex uint8
} func (this SimpleEnum) ToString() string { switch this.VariantIndex { case 0: return "Nothing" case 1: return "Day" case 2: return "Month" case 3: return "Year" default: panic("Unknown SimpleEnum Variant Index") }
} Simple enums don't have anything attach to it besides the variant index. The scale encoding and decoding is done automatically so there is no need to write our own encode/decode methods. In order to know how many variants there are and what each variant means, we create the ToString() method that shows thats. In order to set the enum to a variant, we just need to set VariantIndex to the desired and correct value. Example of correct setup: enum := SimpleEnum{}
enum.VariantIndex = 1 Example of incorrect setup: // VariantIndex out of range
enum := SimpleEnum{}
enum.VariantIndex = 200

