) func RunStorage() { sdk, err := SDK.NewSDK(SDK.TuringEndpoint) PanicOnError(err) blockHash, err := prim.NewH256FromHexString("0x9e813bb85fca217f8f3967bd4b550b05f7d559412571ca1dd621aa37343b300b") PanicOnError(err) blockStorage, err := sdk.Client.StorageAt(prim.Some(blockHash)) PanicOnError(err) // Simple Storage { storage := staPallet.StorageMinValidatorBond{} val, err := storage.Fetch(&blockStorage) PanicOnError(err) fmt.Println("Min Validator Bond: ", val.ToHuman()) } // Simple Storage that returns Option { storage := staPallet.StorageCurrentEra{} val, err := storage.Fetch(&blockStorage) PanicOnError(err) if val.IsSome() { fmt.Println("Current Era: ", val.Unwrap()) } } // Fetch Map Storage { storage := sysPallet.StorageAccount{} acc, err := prim.NewAccountIdFromAddress("5C869t2dWzmmYkE8NT1oocuEEdwqNnAm2XhvnuHcavNUcTTT") PanicOnError(err) val, err := storage.Fetch(&blockStorage, acc) PanicOnError(err) fmt.Println("Account Key: ", val.Key.ToHuman()) fmt.Println("Account Nonce: ", val.Value.Nonce) fmt.Println("Account Free Balance: ", val.Value.AccountData.Free.ToHuman()) } // Fetch Map Storage 2 { storage := daPallet.StorageAppKeys{} value1, err := storage.Fetch(&blockStorage, []byte("ThisShouldNotExist")) PanicOnError(err) AssertEq(value1.IsNone(), true, "") value2, err := storage.Fetch(&blockStorage, []byte("gohan")) PanicOnError(err) AssertEq(value2.IsSome(), true, "") val2 := value2.Unwrap() fmt.Println("Key: ", string(val2.Key)) fmt.Println("AppId: ", val2.Value.AppId) fmt.Println("Owner: ", val2.Value.Owner.ToSS58()) } // Fetch All Map Storage { storage := idenPallet.StorageIdentityOf{} val, err := storage.FetchAll(&blockStorage) PanicOnError(err) AssertTrue(len(val) > 0, "There need to be more than 0 values") AssertEq(len(val), 120, "") for i := 0; i < len(val); i++ { fmt.Println("Identity Key: ", val[i].Key.ToHuman()) fmt.Println("Identity Deposit: ", val[i].Value.T0.Deposit.ToHuman()) fmt.Println("Identity Display: ", val[i].Value.T0.Info.Display.ToHuman()) if i >= 2 { break } } } // Fetch Double Map Storage { storage := staPallet.StorageErasValidatorPrefs{} era := uint32(299) acc, err := prim.NewAccountIdFromAddress("5EFTSpRN2nMZDLjkniBYdmMxquMNm5CLVsrX2V3HHue6QFFF") PanicOnError(err) val, err := storage.Fetch(&blockStorage, era, acc) PanicOnError(err) fmt.Println("Era: ", val.Key1) fmt.Println("Address: ", val.Key2.ToHuman()) fmt.Println("Commission: ", val.Value.Commission.ToHuman()) fmt.Println("Blocked: ", val.Value.Blocked) } // Fetch All Double Map Storage { storage := staPallet.StorageErasValidatorPrefs{} era := uint32(299) val, err := storage.FetchAll(&blockStorage, era) PanicOnError(err) AssertTrue(len(val) > 0, "There need to be more than 0 values") AssertEq(len(val), 80, "") for i := 0; i < len(val); i++ { fmt.Println("Era: ", val[i].Key1) fmt.Println("Address: ", val[i].Key2.ToHuman()) fmt.Println("Commission: ", val[i].Value.Commission.ToHuman()) fmt.Println("Blocked: ", val[i].Value.Blocked) if i >= 2 { break } } } fmt.Println("RunStorage finished correctly.")
}

