} func RunProxyNormal() { sdk, err := SDK.NewSDK(SDK.LocalEndpoint) PanicOnError(err) proxyAccount := SDK.Account.Bob() proxyAccountMulti := primitives.NewAccountIdFromKeyPair(proxyAccount).ToMultiAddress() mainAccount := SDK.Account.Ferdie() mainAccountMulti := primitives.NewAccountIdFromKeyPair(mainAccount).ToMultiAddress() // Creating proxy proxyType := metadata.ProxyType{VariantIndex: 0} // Any Proxy tx := sdk.Tx.Proxy.AddProxy(proxyAccountMulti, proxyType, 0) res, err := tx.ExecuteAndWatchInclusion(mainAccount, SDK.NewTransactionOptions()) PanicOnError(err) AssertTrue(res.IsSuccessful().UnsafeUnwrap(), "Transaction has to succeed") // Finding the ProxyAdded Event eventMyb := SDK.EventFindFirst(res.Events.UnsafeUnwrap(), pxPallet.EventProxyAdded{}) event := eventMyb.UnsafeUnwrap().UnsafeUnwrap() fmt.Println(fmt.Sprintf(`Delegatee: %v, Delegator %v, ProxyTpe %v, Delay: %v`, event.Delegatee.ToHuman(), event.Delegator.ToHuman(), event.ProxyTpe.ToHuman(), event.Delay)) // Executing the Proxy.Proxy() call call := pallets.ToCall(baPallet.CallTransferKeepAlive{Dest: proxyAccountMulti, Value: SDK.OneAvail()}) tx = sdk.Tx.Proxy.Proxy(mainAccountMulti, primitives.None[metadata.ProxyType](), call) res, err = tx.ExecuteAndWatchInclusion(proxyAccount, SDK.NewTransactionOptions()) PanicOnError(err) AssertTrue(res.IsSuccessful().UnsafeUnwrap(), "Transaction has to succeed") // Finding ProxyExecuted event. event2Myb := SDK.EventFindFirst(res.Events.UnsafeUnwrap(), pxPallet.EventProxyExecuted{}) event2 := event2Myb.UnsafeUnwrap().UnsafeUnwrap() AssertEq(event2.Result.VariantIndex, 0, "Proxy must be successful") // Removing Proxy tx = sdk.Tx.Proxy.RemoveProxy(proxyAccountMulti, proxyType, 0) res, err = tx.ExecuteAndWatchInclusion(mainAccount, SDK.NewTransactionOptions()) PanicOnError(err) AssertTrue(res.IsSuccessful().UnsafeUnwrap(), "Transaction has to succeed") // Finding for EventProxyRemoved event. event3Myb := SDK.EventFindFirst(res.Events.UnsafeUnwrap(), pxPallet.EventProxyRemoved{}) event3 := event3Myb.UnsafeUnwrap().UnsafeUnwrap() AssertEq(event2.Result.VariantIndex, 0, "Event must OK") fmt.Println(fmt.Sprintf(`Delegatee: %v, Delegator %v, ProxyTpe %v, Delay: %v`, event3.Delegatee.ToHuman(), event3.Delegator.ToHuman(), event3.ProxyTpe.ToHuman(), event3.Delay)) fmt.Println("RunProxyNormal finished correctly.")
} func RunProxyPure() { sdk, err := SDK.NewSDK(SDK.LocalEndpoint) PanicOnError(err) mainAccount := SDK.Account.Bob() // Creating Pure Proxy proxyType := metadata.ProxyType{VariantIndex: 0} // Any Proxy index := uint16(0) tx := sdk.Tx.Proxy.CreatePure(proxyType, 0, index) res, err := tx.ExecuteAndWatchInclusion(mainAccount, SDK.NewTransactionOptions()) PanicOnError(err) AssertTrue(res.IsSuccessful().UnsafeUnwrap(), "Transaction has to succeed") // Finding PureCreated Event eventMyb := SDK.EventFindFirst(res.Events.UnsafeUnwrap(), pxPallet.EventPureCreated{}) event := eventMyb.UnsafeUnwrap().UnsafeUnwrap() fmt.Println(fmt.Sprintf(`Pure: %v, Who %v, ProxyType %v, Index: %v`, event.Pure.ToHuman(), event.Who.ToHuman(), event.ProxyTpe.ToHuman(), event.DisambiguationIndex)) pureProxy := event.Pure // Executing the Proxy.Proxy() call key := fmt.Sprintf("MyKey%v", rand.Uint32()) call := pallets.ToCall(daPallet.CallCreateApplicationKey{Key: []byte(key)}) tx = sdk.Tx.Proxy.Proxy(pureProxy.ToMultiAddress(), primitives.None[metadata.ProxyType](), call) res, err = tx.ExecuteAndWatchInclusion(mainAccount, SDK.NewTransactionOptions()) PanicOnError(err) AssertTrue(res.IsSuccessful().UnsafeUnwrap(), "Transaction has to succeed") // Finding the Proxy Executed Event event2Myb := SDK.EventFindFirst(res.Events.UnsafeUnwrap(), pxPallet.EventProxyExecuted{}) event2 := event2Myb.UnsafeUnwrap().UnsafeUnwrap() AssertEq(event2.Result.VariantIndex, 0, "Event must OK") fmt.Println(fmt.Sprintf(`Dispatch Result: %v`, event2.Result.ToString())) fmt.Println("RunProxyPure finished correctly.")
} func RunProxyFailure() { sdk, err := SDK.NewSDK(SDK.LocalEndpoint) PanicOnError(err) proxyAccount := SDK.Account.Bob() proxyAccountMulti := primitives.NewAccountIdFromKeyPair(proxyAccount).ToMultiAddress() mainAccount := SDK.Account.Ferdie() mainAccountMulti := primitives.NewAccountIdFromKeyPair(mainAccount).ToMultiAddress() // Creating proxy proxyType := metadata.ProxyType{VariantIndex: 1} // NonTransfer tx := sdk.Tx.Proxy.AddProxy(proxyAccountMulti, proxyType, 0) res, err := tx.ExecuteAndWatchInclusion(mainAccount, SDK.NewTransactionOptions()) PanicOnError(err) AssertTrue(res.IsSuccessful().UnsafeUnwrap(), "Transaction has to succeed") // Executing the Proxy.Proxy() call call := pallets.ToCall(baPallet.CallTransferKeepAlive{Dest: proxyAccountMulti, Value: SDK.OneAvail()}) tx = sdk.Tx.Proxy.Proxy(mainAccountMulti, primitives.None[metadata.ProxyType](), call) res, err = tx.ExecuteAndWatchInclusion(proxyAccount, SDK.NewTransactionOptions()) PanicOnError(err) AssertTrue(res.IsSuccessful().UnsafeUnwrap(), "Transaction has to succeed") // Finding ProxyExecuted event. event2Myb := SDK.EventFindFirst(res.Events.UnsafeUnwrap(), pxPallet.EventProxyExecuted{}) event2 := event2Myb.UnsafeUnwrap().UnsafeUnwrap() AssertEq(event2.Result.VariantIndex, 1, "Proxy must fail") fmt.Println("Failure", event2.Result.Err.UnsafeUnwrap().ToHuman()) // Removing Proxy tx = sdk.Tx.Proxy.RemoveProxy(proxyAccountMulti, proxyType, 0) res, err = tx.ExecuteAndWatchInclusion(mainAccount, SDK.NewTransactionOptions()) PanicOnError(err) AssertTrue(res.IsSuccessful().UnsafeUnwrap(), "Transaction has to succeed") fmt.Println("RunProxyFailure finished correctly.")
}

